                    e.append('<p dir="ltr">If you use Google Analytics for monitoring your statistics, you can get more data by setting up transfer of data for a certain status. The setup of data transfer in Google Analytics can only be setup for one status of each pipeline.</p><p dir="ltr">Every request from a webform or JivoSite chat contains details of users from Google Analytics.</p><p dir="ltr">Once lead has changed its status to the one you&rsquo;ve setup the transfer of data to Google Analytics, you&rsquo;ll be able to see the reports on Google Analytics site in Real Time Mode section =&gt; Events and Conversion.</p><p dir="ltr">In order to get information and working with UTM-tags, it is necessary to add them to your url&rsquo;s. Meanings of UTM-tags will appear in corresponding fields of the lead card and in Google Analytics under Traffic Sources =&gt; All Traffic</p><p dir="ltr">For more detailed analysis of your advertising campaigns and pipeline you can perform additional setup of Google Analytics.</p><p dir="ltr"><strong>Google Analytics integration</strong></p><p dir="ltr"><strong>Target setup in Google Analytics</strong></p><p dir="ltr">Create target (Administrator &ndash; Targets) in 3 steps:</p><ol dir="ltr"><li>Select template &ndash; Create an order</li><li>Name any. Type &ndash; Target.</li><li>When setting up the sequence for the step, please specify the name of page or addon screen (same as in Target field)<ul dir="ltr"><li>Target: /kommo/payment. Please specify type of conformity for setting the target: Equal , Begins with or Regular expression.</li><li>You can set the conversion value as required</li><li>Sequence: you must show the path to the target, where you expect to get the traffic from. It&rsquo;ll help to determine the most important areas. In our case, it is necessary to show the path to the page with form - /kommo/form</li></ul></li></ol><p dir="ltr">Important! /kommo/form and /kommo/payment are sent to Google Analytics.</p><p dir="ltr">If they are changed, the functionality will also change. Because the notifications are sent to these pages.</p><p dir="ltr">Next time, when the form is sent, there will be utm-tags in the lead card and notification about the /kommo/form visit will go to Google Analytics (they can be viewed in real time or in reports) When the lead will change its status to the one where transfer of data is setup, the information about the page visit will be transferred to Google Analytics.</p><p dir="ltr">If you try to delete Google Analytics fields while Google Analytics is active, fields will automatically be created again.</p><p dir="ltr">If you turn off Google Analytics fields will remain in place for the data to be complete.</p>')
