                    e.append('<p dir="ltr">Si utiliza el sistema de seguimiento de las estad&iacute;sticas de Google Analytics, puede obtener informaci&oacute;n adicional s&oacute;lo configurando env&iacute;o de datos al cierto estatus. El env&iacute;o a Google Analytics puede ser configurado para s&oacute;lo un estatus de cada embudo.</p><p dir="ltr">Cada solicitud del formulario o de chat JivoSite contiene datos sobre el usuario de Google Analytics.</p><p dir="ltr">Despu&eacute;s de obtener el acuerdo el estatus para el cual se ha configurado el env&iacute;o de datos a Google Analytics, puede ver los informes en el sitio web de Google Analytics en<a href="http://www.lingvo-online.ru/ru/Search/Translate/GlossaryItemExtraInfo?text=%d1%80%d0%b0%d0%b7%d0%b4%d0%b5%d0%bb&amp;translation=secci%c3%b3n&amp;srcLang=ru&amp;destLang=es"> secci&oacute;n</a> =&gt; &quot;Eventos en tiempo real &quot; =&gt; &quot; Eventos &quot; y &quot;Conversi&oacute;n&quot;.</p><p dir="ltr">Para obtener informaci&oacute;n y trabajar con los UTM-etiquetas, hay que a&ntilde;adirlos a sus url. Valores de UTM-etiquetas se mostrar&aacute;n en los respectivos campos no editables en las tarjetas de &quot;Acuerdos&quot;, as&iacute; como en la p&aacute;gina web GA en<a href="http://www.lingvo-online.ru/ru/Search/Translate/GlossaryItemExtraInfo?text=%d1%80%d0%b0%d0%b7%d0%b4%d0%b5%d0%bb&amp;translation=secci%c3%b3n&amp;srcLang=ru&amp;destLang=es"> secci&oacute;n</a> &quot;Fuentes de tr&aacute;fico&quot; =&gt; &quot;Todo el tr&aacute;fico&quot;.</p><p dir="ltr">Puede realizar una configuraci&oacute;n adicional de Google Analytics para an&aacute;lisis m&aacute;s detallado de las campa&ntilde;as publicarias y embudo.</p><p dir="ltr">&nbsp;</p><p dir="ltr"><strong>Integraci&oacute;n de Google Analytics</strong></p><p dir="ltr"><strong>Configuraci&oacute;n de objetivos en Google Analytics</strong></p><p dir="ltr">Creamos un objetivo (Administrador - Objetivos) en 3 pasos:</p><ol dir="ltr"><li>Elija una plantilla &ndash; Hacer un pedido</li><li>Сualquier t&iacute;tulo. Tipo - Objetivo.</li><li>Cuando establece la secuencia entre el nombre de la p&aacute;gina o pantalla de aplicaci&oacute;n como un paso (as&iacute; como en el campo Objetivo).<ul dir="ltr"><li>El objetivo: / amocrm / payment. Para establecer los objetivos hay que especificar el tipo de concordancia: Igual o Comienza con, o Expresi&oacute;n Regular.</li><li>Asignar el valor de la conversi&oacute;n a su discreci&oacute;n.</li><li>Secuencia: se debe especificar la ruta al objetivo para el que espera recibir tr&aacute;fico. Esto ayudar&aacute; a identificar las &aacute;reas m&aacute;s importantes. En este caso, debe especificar la ruta de acceso a la p&aacute;gina con la forma - / amocrm / form</li></ul></li></ol><p dir="ltr">&nbsp;</p><p dir="ltr">&iexcl;Importante! En Google Analytics se env&iacute;an / amocrm / forma y / amocrm / payment.</p><p dir="ltr">Si los cambian, la correcci&oacute;n del trabajo ser&aacute; roto.</p><p dir="ltr">Ya que es en estas p&aacute;ginas virtuales se env&iacute;an una notificaci&oacute;n.</p><p dir="ltr">La pr&oacute;xima vez que se env&iacute;a el formulario, las UTM-etiquetas se agregar&aacute;n a los acuerdos y datos sobre el visito a la p&aacute;gina web / amocrm / form se enviar&aacute;n a Google Analytics (se puede ver en tiempo real o en los informes). Cuando el acuerdo obtiene el estatus para el que se configura el env&iacute;o de datos, a Google Analytics se enviar&aacute; informaci&oacute;n acerca de visito de la p&aacute;gina / amocrm / payment y de la transacci&oacute;n.</p><p dir="ltr">Con Google Analytics activada cuando intente eliminar el campo de GA, se recrear&aacute; de nuevo.</p><p dir="ltr">Si deactiva Google Analytics los campos no se eliminar&aacute;n para mantener la integridad de los datos.</p>')
