                    e.append('<p dir="ltr">Jika kamu menggunakan Google Analytics untuk memantau statistik, kamu bisa mendapatkan lebih banyak data dengan mengatur transfer data untuk status tertentu. Pengaturan transfer data di Google Analytics hanya dapat diatur untuk satu status dari setiap pipeline.</p><p dir="ltr">Setiap permintaan dari webform atau chat JivoSite berisi detail pengguna dari Google Analytics.</p><p dir="ltr">Setelah lead berubah status menjadi salah satu yang telah kamu siapkan transfer datanya ke Google Analytics, kamu akan dapat melihat laporannya di situs Google Analytics di bagian Mode Real Time => Peristiwa dan Konversi.</p><p dir="ltr">Untuk mendapatkan informasi dan bekerja dengan tag UTM, kamu perlu menambahkannya ke url kamu. Arti tag UTM akan muncul di kolom yang sesuai di kartu lead dan di Google Analytics di bawah Sumber Traffic => Semua Traffic</p><p dir="ltr">Untuk analisis yang lebih rinci tentang kampanye dan pipeline iklanmu, kamu dapat melakukan pengaturan tambahan Google Analytics.</p><p dir="ltr"><strong>Integrasi Google Analytics</strong></p><p dir="ltr"><strong>Pengaturan target di Google Analytics</strong></p><p dir="ltr">Buat target (Administrator - Target) dalam 3 langkah:</p><ol dir="ltr"><li>Pilih template - Buat pesanan</li><li>Sebutkan. Jenis – Target.</li><li>Saat mengatur urutan langkah, tentukan nama halaman atau layar tambahan (sama seperti di kolom Target)<ul dir="ltr"><li>Target: /kommo/payment. Harap tentukan jenis kesesuaian untuk menetapkan target: Sama, Dimulai dengan atau Ekspresi reguler.</li><li>Kamu dapat mengatur nilai konversi sesuai kebutuhan</li><li>Urutan: Kamu harus menunjukkan jalur menuju target, dari mana kamu berharap untuk mendapatkan traffic. Ini akan membantu menentukan area yang paling penting. Dalam kasus kami, perlu untuk menunjukkan jalur ke halaman dengan formulir - /kommo/form</li></ul></li></ol><p dir="ltr">Penting! /kommo/form dan /kommo/payment dikirim ke Google Analytics.</p><p dir="ltr">Jika diubah, fungsionalitasnya juga akan berubah. Karena notifikasi dikirim ke halaman-halaman ini.</p><p dir="ltr">Selanjutnya, saat formulir dikirim, akan ada utm-tag di kartu lead dan notifikasi tentang kunjungan /kommo/formulir akan masuk ke Google Analytics (dapat dilihat secara real time atau di laporan) Saat lead akan mengubah statusnya ke status di mana transfer data disiapkan, informasi tentang kunjungan halaman akan ditransfer ke Google Analytics.</p><p dir="ltr">Jika kamu mencoba menghapus kolom Google Analytics saat Google Analytics aktif, kolom akan secara otomatis dibuat lagi.</p><p dir="ltr">Jika kamu mematikan Google Analytics, kolom-kolom akan tetap ada agar data menjadi lengkap.</p>')
