                    e.append('<p dir="ltr">Se você usa o Google Analytics para monitorar suas estatísticas, pode obter mais dados configurando a transferência de dados para um determinado status. A configuração da transferência de dados no Google Analytics pode ser configurada apenas para um status de cada funil.</p><p dir="ltr">Toda solicitação de um bate-papo na Web ou JivoSite contém detalhes de usuários do Google Analytics.</p><p dir="ltr">Uma vez que o lead mudou seu status para esse configure a transferência de dados para o Google Analytics, poderá ver os relatórios no site do Google Analytics na seção Modo em tempo real =&gt; Eventos e Conversão.</p><p dir="ltr">Para obter informações e trabalhar com tags UTM, é necessário adicioná-las à sua url. Os significados das tags UTM aparecerão nos campos correspondentes do cartão principal e no Google Analytics em Origens de tráfego =&gt; Todo o tráfego</p><p dir="ltr">Para uma análise mais detalhada de suas campanhas e funis de publicidade, você pode executar configurações adicionais do Google Analytics.</p><p dir="ltr"><strong>Integração com o Google Analytics</strong></p><p dir="ltr"><strong>Configuração de destino no Google Analytics</strong></p><p dir="ltr">Crie o destino (Administrador &ndash; destinos) em 3 etapas:</p><ol dir="ltr"><li>Selecione o modelo &ndash; Crie um pedido</li><li>Nomeie qualquer. Tipo &ndash; Destino. </li><li>Ao configurar a sequência para o passo, especifique o nome da página ou da tela de complementos (o mesmo que no campo Destino)<ul dir="ltr"><li>Destino: /kommo/payment. Especifique o tipo de conformidade para definir o destino: Igual, Começa com ou Expressão regular.</li><li>Você pode definir o valor da conversão conforme necessário</li><li>Sequência: você deve mostrar o caminho para o destino, de onde espera obter o tráfego. Isso ajudará a determinar as áreas mais importantes. No nosso caso, é necessário mostrar o caminho para a página com o formulário - /kommo/form</li></ul></li></ol><p dir="ltr">Importante! /kommo/form e /kommo/payment são enviados ao Google Analytics.</p><p dir="ltr">Se eles forem alterados, a funcionalidade também será alterada. Porque as notificações são enviadas para essas páginas.</p><p dir="ltr">Na próxima vez em que o formulário for enviado, haverá utm-tags no cartão do lead e a notificação sobre a visita /kommo/form irá para o Google Analytics (eles podem ser visualizados em tempo real ou em relatórios) Quando o lead for alterado seu status para aquele em que a transferência de dados está configurada, as informações sobre a visita à página serão transferidas para o Google Analytics.</p><p dir="ltr">Se você tentar excluir os campos do Google Analytics enquanto o Google Analytics estiver ativo, os campos serão criados automaticamente novamente.</p><p dir="ltr">Se você desativar os campos do Google Analytics, eles permanecerão no local para que os dados sejam concluídos.</p>')
