                    i = void 0 === i ? {} : i,
                    e.append('<p dir="ltr">Если вы используете для отслеживания статистики систему Google Analytics, то вы сможете получать дополнительную информацию, просто настроив отправку данных для определенного статуса. Отправка в Google Analytics может быть настроена только в одном статусе для каждой воронки.</p><p dir="ltr">Каждая заявка из формы или из чата JivoSite содержит данные о пользователе из Google.Analytics.</p><p dir="ltr">После перевода сделки в статус, в котором вы настроили отправку данных в Google Analytics, Вы можете просмотреть отчеты на сайте Google Analytics в разделе &laquo;Режим реального времени&raquo; =&gt; &laquo;События&raquo; и &laquo;Конверсия&raquo;.</p><p dir="ltr">Для получения информации и работы с UTM-метками, необходимо добавить их к вашим url. Значения UTM-меток будут отображаться в соответствующих нередактируемых полях в карточке &laquo;Сделки&raquo;, а также на сайте GA в разделе &laquo;Источники трафика&raquo; =&gt; &laquo;Весь трафик&raquo;.</p><p dir="ltr">Для более подробного анализа рекламных компаний и воронки вы можете произвести дополнительные настройки Google Analytics.</p><p dir="ltr"><strong>Подключение Google Analytics</strong></p><p dir="ltr"><strong>Настройка целей в Google Analytics</strong></p><p dir="ltr">Создаем цель (Администратор - Цели) из 3 шагов:</p><ol dir="ltr"><li>Выбираем шаблон - Оформить заказ</li><li>Название любое. Тип &ndash; Цель.</li><li>При настройке последовательности в качестве шага укажите название страницы или экрана приложения (как в поле Цель ).</li></ol><ul dir="ltr" style="margin-left: 40px;"><li>Цель: /kommo/payment. Для настройки цели вам нужно будет указать тип соответствия: Равно , Начинается с или Регулярное выражение.</li><li>Назначать ценность конверсии вы можете по своему усмотрению.</li><li>Последовательность: необходимо указать путь к цели, по которому вы ожидаете получать трафик. Это поможет выявить наиболее важные участки. В нашем случае необходимо указать путь к странице с формой - /kommo/form</li></ul><p dir="ltr">Важно! В Google Analytics отправляются /kommo/form и /kommo/payment.</p><p dir="ltr">Если их изменить, то корректность работы будет нарушена.</p><p dir="ltr">Поскольку именно на эти виртуальные страницы отправляются уведомления.</p><p dir="ltr">В следующий раз, когда форма будет отправлена, в сделке будут прописаны utm метки, а в Google Analytics уйдут данные о посещении страницы /kommo/form (можно посмотреть в реальном времени или в отчетах). Когда у сделки будет выставлен статус, в котором настроена отправка данных , в Google Analytics будет передана информация о посещении страницы /kommo/payment и транзакция.</p><p dir="ltr">При включенной Google Analytics и при попытке удалить GA-поля они будут сразу пересозданы заново!</p><p dir="ltr">При отключении Google Analytics поля удалены не будут для целостности данных.</p>')
